import java.util.*;
import java.math.*;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        long a = sc.nextLong();
        long b = sc.nextLong();
        Set<Long> s = new HashSet<>();
        for (long i = a; i <= b; i++) {
            s.add(i);
        }
        Set<Long> ans = new HashSet<>();
        ans.add(0L);
        for (long i : s) {
            Set<Long> next = new HashSet<>();
            for (long j : ans) {
                next.add(j | i);
            }
            ans.addAll(next);

        }
        ans.remove(0L);
        System.out.println(ans.size());
    }
}
